declare(strict_types=1);

namespace Bat\CustomerGraphQl\Test\Unit\Model\Resolver\Customer;

use Magento\TestFramework\TestCase\GraphQlAbstract;
use Magento\TestFramework\Helper\Bootstrap;
use Magento\Integration\Model\Oauth\TokenFactory;
use Magento\Customer\Api\CustomerRepositoryInterface;

/**
 * Class Customer Deactivation
 *
 */
class CustomerDeactivationTest extends GraphQlAbstract
{
   /**
    * Customer Deactivation
    */
    public function testCustomerDeactivation()
    {
        $query
            = <<<QUERY
mutation {
    deactivateCustomer (
        input : {
            bank_account_card: {
                card_name : "lotus.jpg"
                card_file : "data:image/jpeg;base64,"
            }
            account_closing_date : "2023-07-12"
            returning_stock : 0
            consent_form: 1
        } )
        {
        success
        message
    }
    }
QUERY;
        $response = $this->graphQlMutation($query, [], '', $this->getHeaderMap());
        $this->assertIsArray($response['deactivateCustomer']);
        $this->assertNotEmpty($response['deactivateCustomer']);
        $response = $response['deactivateCustomer'];
        $this->assertArrayHasKey('message', $response);
    }

    /**
     * Retrieve customer authorization headers
     *
     * @param string $username
     * @return array
     * @throws AuthenticationException
     */
    private function getHeaderMap(string $username = 'ansh@mailinator.com'): array
    {
        $objectManager = Bootstrap::getObjectManager();
        $CustomerRepository = $objectManager->get(CustomerRepositoryInterface::class);
        $customerData = $CustomerRepository->get($username);
        $customerId = (int)$customerData->getId();
        $customerTokenService = $objectManager->get(TokenFactory::class);
        $customerToken = $customerTokenService->create();
        $customerTokenVal = $customerToken->createCustomerToken($customerId)->getToken();
        $headerMap = ['Authorization' => 'Bearer ' . $customerTokenVal];
        return $headerMap;
    }
}
